La #RATP fête ses 70 ans et  vous annonce un trafic fluide sur toutes les lignes y compris le #RERB !
En effet,  @ClientsRATP ne signal les incidents qu'après 30 a 40 minutes de coupure du @RERB 
@IDFmobilites @vpecresse @Anne_Hidalgo @marieadamb #RATPlaLigne @Actu_Transilien [LIEN]

La RATP justifie donc des infractions qui bloquent la passage des cyclistes pour cause de tenue des horaires... 

On voit pas bien le temps gagné sur ce coup là, mais on est très très énervés (et fatigués) quand même ! 😤😣

